import './home.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Particles from 'react-particles-js';
import AlternateEmailIcon from '@mui/icons-material/AlternateEmail';
function Home() {
    return (
        <div className="home">
            <Particles className="particles" />
            <div className="slideContainer">
                <img className="mainSlide" src="imgs/main-slide-2.png" alt="" />
                <img className="mobileMainSlide" src="imgs/main-slide-mobile-meidum1.png" alt="" />
                <h1 className="mainName">Emad Saeed</h1>
                <h2 className="mainTitle">Full Stack Developer</h2>
                <h1 className="slogan">Get the idea done from concept to implementation!</h1>
                <button className='contactMeBtn' variant="outlined" size="large" ><AlternateEmailIcon style={{ marginRight: 10, marginBottom: 5 }} />Contact me!</button>
            </div>
        </div >
    )
}

export default Home
